#include <iostream>
using namespace std;

int main() {
    int panjang, lebar, r;
    double luasPersegiPanjang, luasLingkaran, hasil;

    cout << "PERSEGI PANJANG" << endl;

    cout << "panjang: ";
    cin >> panjang;

    cout << "lebar: ";
    cin >> lebar;

    cout << "LINGKARAN" << endl;

    cout << "jari-jari: ";
    cin >> r;

    luasPersegiPanjang = panjang * lebar;
    luasLingkaran = 3.14 * r * r;

    hasil = luasPersegiPanjang - luasLingkaran;

    cout << "HASIL: " << hasil;

    return 0;
}
